import styled from 'styled-components';

export const Container = styled.div `
    width: 85vw;
    height: 99vh;
    margin-left: 1vw;
    margin-top: 1vh;
    overflow-y: scroll;
    > div {
        width:80vw;
    }
    > p
`;
